import { AlertsComponent } from './alerts/alerts.component';
import { SuccessAlertComponent } from './success-alert/success-alert.component';

@NgModule({
  declarations: [
    AppComponent,
    ServerComponent,
    ServersComponent,
    WarningAlertComponent,
    AlertsComponent,
    SuccessAlertComponent,
  ],
